class ApiLibrary{

    GetThumbData = async (videoCode) => {
        
        let url = `${window.location.origin}/api/video/thumb/${videoCode}`;
        console.log(url)
        const json = await (
            await fetch(url)
        );

        console.log(json)
        console.log(json.json())
        console.log(json.json().PromiseResult)

        return json.json().PromiseResult[0];
    };
}


export default ApiLibrary;
